    private function getDynamicParameter(string $name)
    {
        switch ($name) {
            case 'kernel.runtime_environment': $value = $this->getEnv('default:kernel.environment:APP_RUNTIME_ENV'); break;
            case 'kernel.build_dir': $value = $this->targetDir.''; break;
            case 'kernel.cache_dir': $value = $this->targetDir.''; break;
            case 'elasticsearch_total_fields_limit': $value = $this->getEnv('APP_ELASTICSEARCH_TOTAL_FIELDS_LIMIT'); break;
            case 'index_list_changed_total_field_limit': $value = [
                0 => $this->getEnv('APP_PRODUCT_AND_PRODUCT_MODEL_INDEX_NAME'),
            ]; break;
            case 'comm_panel_api_url': $value = $this->getEnv('COMM_PANEL_API_URL'); break;
            case 'index_hosts': $value = $this->getEnv('APP_INDEX_HOSTS'); break;
            case 'product_and_product_model_index_name': $value = $this->getEnv('APP_PRODUCT_AND_PRODUCT_MODEL_INDEX_NAME'); break;
            case 'connection_error_index_name': $value = $this->getEnv('APP_CONNECTION_ERROR_INDEX_NAME'); break;
            case 'events_api_debug_index_name': $value = $this->getEnv('APP_EVENTS_API_DEBUG_INDEX_NAME'); break;
            case 'doctrine.orm.proxy_dir': $value = ($this->targetDir.''.'/doctrine/orm/Proxies'); break;
            case 'kernel.secret': $value = $this->getEnv('APP_SECRET'); break;
            case 'kernel.default_locale': $value = $this->getEnv('APP_DEFAULT_LOCALE'); break;
            case 'serializer.mapping.cache.file': $value = ($this->targetDir.''.'/serialization.php'); break;
            case 'session.save_path': $value = ($this->targetDir.''.'/sessions'); break;
            case 'validator.mapping.cache.file': $value = ($this->targetDir.''.'/validation.php'); break;
            default: throw new InvalidArgumentException(sprintf('The dynamic parameter "%s" must be defined.', $name));
        }
        $this->loadedDynamicParameters[$name] = true;

        return $this->dynamicParameters[$name] = $value;
    }

